import React from 'react';
import { Card, CardImg, Container, Button, CardTitle, CardText, Row, Col } from 'reactstrap';

import "../App.css"




const ContentBox = (props) => {
  return (
  <Container>
    <Row>
      <Col sm="4">
        <div className="box">
        <img src={require(`../assets/store.png`)} alt="Card image cap" />
        <h4>Lokasi Outlet</h4>
        </div>
      </Col>
      <Col sm="4">
        <div className="box">
        <img src={require(`../assets/snack.png`)} alt="Card image cap" />
        <h4>Jenis Snack</h4>
        </div>
      </Col>

      <Col sm="4">
        <div className="box">
        <img src={require(`../assets/delivery-truck.png`)} alt="Card image cap" />
        <h4>Pengiriman</h4>
        </div>
      </Col>
    </Row>
  </Container>
  );
};

export default ContentBox;
